    false,nt"url": null,nt"notes": "This data is the 2001 era or late-date
    classification of the Great Lakes. This data set consists of about 74 partial Landsat
    7 Thematic Mapper scenes which were analyzed according to the Coastal Change Analysis
    Program (C-CAP) protocol to determine land cover. The data were field validated
    and subsequently mosaicked to produce a land cover inventory for a portion of the
    US Great Lakes Coastal Zone.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
